def findMaxLength(nums):
        
    maxx = 0
    
    size = len(nums)
    
    for i in range(size):
        count0 = 0
        count1 = 0
        if maxx >= (size - i):
            break
        for j in range(i, size):        
            
            if nums[j] == 0:
                count0 += 1
            else:
                count1 += 1
            if count0 == count1:                    
                maxx = max(maxx, (j - i + 1))
            # print("i:", i, "j:", j, "zero:", count0, "one:", count1)
            if maxx == size or abs(count0 - count1) > (size - j - 1):
                break
            
    return maxx

